import React from "react";
import './navbar1.css';
const Navbar=()=>{
return(
  <div className="Navbar">
    <div className="Icon">
    <img alt="logo" src="https://in.images.search.yahoo.com/search/images;_ylt=Awr1TU3ElVxmil4TR8a7HAx.;_ylu=Y29sbwNzZzMEcG9zAzEEdnRpZAMEc2VjA3Nj?p=cart+icon+pics&vm=r&type=E210IN714G0&ei=UTF-8&fr=mcafee&th=117.2&tw=108.7&imgurl=https%3A%2F%2Ficon-library.com%2Fimages%2Fcart-icon%2Fcart-icon-13.jpg&rurl=https%3A%2F%2Fjengordon288.blogspot.com%2F2021%2F06%2Fred-shopping-cart-icon-png.html&size=66KB&name=Red+Shopping+Cart+Icon+Png+-+jengordon288&oid=14&h=1080&w=1000&turl=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.T8iZE96CbXjGFdAHobbtfwHaH_%26pid%3DApi%26rs%3D1%26c%3D1%26qlt%3D95%26w%3D108%26h%3D117&tt=Red+Shopping+Cart+Icon+Png+-+jengordon288&sigr=S6HzPOVFL2ey&sigit=5RpIZwsNzH8J&sigi=xPaLU0a22MRZ&sign=Zzlm_vVsc6Pc&sigt=Zzlm_vVsc6Pc"/>
    <h2>E-cart</h2>
    </div>
    <div className="Menu">
    <ul>
      <li>Men</li>
      <li>Women</li>
      <li>Kids</li>
      <li>New</li>
 </ul>
 </div>
 <button>Login</button>

  </div>
);

}
export default Navbar;
